On this album masterguitarplayer Jan Akkerman joins forces again with singer Kaz Lux to tell the story of the humble carpenter Eli. The result is an album which at least could be described as &quot;different&quot;, but certainly terms as atmospheric and eloquent are appropriate as well. A must have for every wannabe guitarplayer, just for the track &quot;Tranquillizer&quot; in which Jan plays a mesmerizing chord progression with just a Roland Drummachine. 

